let input = "\\\\"

let lastDigit = "C";
let round = 0;
let pinCode = [];

//     1
//   2 3 4
// 5 6 7 8 9
//   A B C
//     D

const keypad = 
  { 1: {"U": 1, "L": 1, "D": 3, "R": 1},
    2: {"U": 2, "L": 2, "D": 6, "R": 3},
    3: {"U": 1, "L": 2, "D": 7, "R": 4},
    4: {"U": 4, "L": 3, "D": 8, "R": 4},
    5: {"U": 5, "L": 5, "D": 5, "R": 6},
    6: {"U": 2, "L": 5, "D": "A", "R": 7},
    7: {"U": 3, "L": 6, "D": "B", "R": 8},
    8: {"U": 4, "L": 7, "D": "C", "R": 9},
    9: {"U": 9, "L": 8, "D": 9, "R": 9},
   "A": {"U": 6, "L": "A", "D": "A", "R": "B"},
   "B": {"U": 7, "L": "A", "D": "D", "R": "C"},
   "C": {"U": 8, "L": "B", "D": "C", "R": "C"},
   "D": {"U": "B", "L": "D", "D": "D", "R": "D"}
  }

function findDigit(steps) {
  for (i = 0; i < steps.length; i++) {
    lastDigit = keypad[lastDigit][steps[i]];
  }
  pinCode.push(lastDigit);
}


function main() {
  data = input.split("\n");
  for (i = 0; i < data.length; i++) {
    round += 1;
    findDigit(data[i]);
  }
  console.log(pinCode);
}


main();


